webpackJsonp([0xec687181b351],{4774:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Only Time Will Tell",date:"28 Jan 2001",slug:"/2001-01-28-only-time-will-tell/",tags:"Y2001"},html:'<p>In case you couldn\'t tell, I got interrupted last night. Now I forgot what I was going to write.</p>\n<p><a href="http://andrea.editthispage.com">Andrea</a> wrote about the German dairy product <a href="http://andrea.editthispage.com/2001/01/27">Quark</a>. If I had known the English name was "curd", I never would have tried it. I\'d describe Quark as a cross between yogurt and sour cream, not at all like cottage cheese. I like a \'Quark-Creme\' cake, with a mixture of Quark, whipped cream and gelatin poured into a form over strawberries and a shortcake base. </p>\n<p>German Link: Hamburger Abendblatt <a href="http://www.abendblatt.de/contents/ha/news/lokales/html/270101/1327FUS7.HTM">Guildo Horn gibt den Lohengrin in der Staatsoper</a></p>'},next:{fields:{title:"Only Time Will Tell",date:"27 Jan 2001",slug:"/2001-01-27-only-time-will-tell/"}},previous:{fields:{title:"Sometimes you eat the bear, and sometimes the bear eats you",date:"29 Jan 2001",slug:"/2001-01-29-sometimes-you-eat-the-bear-and-sometimes-the-bear-eats-you/"}}},{node:{fields:{title:"Only Time Will Tell",date:"27 Jan 2001",slug:"/2001-01-27-only-time-will-tell/",tags:"Y2001"},html:"<p>Has it really been a week? So it has.</p>"},next:{fields:{title:"Tiger of Magic",date:"21 Jan 2001",slug:"/2001-01-21-tiger-of-magic/"}},previous:{fields:{title:"Only Time Will Tell",date:"28 Jan 2001",slug:"/2001-01-28-only-time-will-tell/"}}},{node:{fields:{title:"Tiger of Magic",date:"21 Jan 2001",slug:"/2001-01-21-tiger-of-magic/",tags:"Y2001"},html:'<p>We just returned from Hannover, where Mama\'s company held a reception for their franchisees. The inauguration was on the hotel TV (4 different channels and languages) as we dressing, and at dinner I was asked about this strange and foreign ritual. One woman said that, watching without sound, the miitary parade, dark coats, somber faces and preacher looked more like a state funeral than anything else. I had no answer to that. </p>\n<p><a href="http://andrea.editthispage.com/2001/01/21">Andrea</a> asked about the movie "Fargo". Since we lived in Minnesota at the time the movie is set, I could <a href="http://andrea.editthispage.com/discuss/msgReader$1708?mode=day">answer her</a>.</p>'},next:{fields:{title:"On Our Way Out the Door",date:"20 Jan 2001",slug:"/2001-01-20-on-our-way-out-the-door/"}},previous:{fields:{title:"Only Time Will Tell",date:"27 Jan 2001",slug:"/2001-01-27-only-time-will-tell/"}}}],pathPrefix:"",first:!1,last:!1,index:1024,pageCount:1101}}}});
